using System;\nusing System.Net;\nusing System.Web.Services.Protocols;\n\nclass JiraSoapClient\n{\n    static void Main(string[] args)\n    {\n        string jiraUrl = "https://your-jira-instance/rpc/soap/jirasoapservice-v2";\n        string username = "your-username";\n        string password = "your-password";\n        string projectKey = "your-project-key";\n\n        JiraSoapServiceService jiraService = new JiraSoapServiceService();\n        jiraService.Url = jiraUrl;\n        CookieContainer cookies = new CookieContainer();\n        jiraService.CookieContainer = cookies;\n\n        try\n        {\n            // Log in to JIRA\n            string authToken = jiraService.login(username, password);\n\n            // Get assignable users for the project\n            RemoteUser[] users = jiraService.getAssignableUsers(authToken, projectKey, 0, int.MaxValue);\n\n            // Display the list of users\n            foreach (RemoteUser user in users)\n            {\n                Console.WriteLine($"{user.name} - {user.displayName}");\n            }\n\n            // Log out from JIRA\n            jiraService.logout(authToken);\n        }\n        catch (SoapException ex)\n        {\n            Console.WriteLine($"SOAP Exception: {ex.Message}");\n        }\n        catch (Exception ex)\n        {\n            Console.WriteLine($"Exception: {ex.Message}");\n        }\n    }\n}